    return(
        <Mask title="congratulations!!!">
                <img src={submited} width="800"/>
                <span>
                    Your application has been submitted pending approval.
                    Shortlisted Applicants will be notified soon.
                </span>
                <button>

                </button>
        </Mask>
    )
}

export default Congratulations;
